import { useEffect, useState } from "react";
import axios from "axios";
import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";
import './Main.css'

const Main = () => {
	const [users, setUsers] = useState([]);

	useEffect(() => {
		axios.get("http://localhost:3000/api/users").then((res) => {
			setUsers(res.data);
		});
	}, []);
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
	};

	return (
		<div className="main_container">
			<nav className="navbar">
				<h1>Dashboard</h1>
				<button className="white_btn" onClick={handleLogout}>
					Logout
				</button>
			</nav>
		
		<LoadScript googleMapsApiKey="AIzaSyD8QNsp59Fb__I1aRHscWr0eAaFK7qYUH8">
			<GoogleMap center={{ lat: 7.8731, lng: 80.7718 }} zoom={7} mapContainerStyle={{ width: "100%", height: "500px" }}>
				{users.map((user, index) => (
					<Marker key={index} position={{ lat: user.latitude, lng: user.longitude }} />
				))}
			</GoogleMap>
		</LoadScript>
		</div>
	);
};

export default Main;
